package com.loginForm.model;

public class userModel {
	
	//getter-setter files..,
	public userModel() {
		// TODO Auto-generated constructor stub
		//set initial value
	}
	
	private String rFirst_name;
	private String rLast_name;
	private String rEmail;
	private String rPassword;
	private String rMno;
	
	
	public String getrFirst_name() {
		return rFirst_name;
	}
	public void setrFirst_name(String rFirst_name) {
		this.rFirst_name = rFirst_name;
	}
	public String getrLast_name() {
		return rLast_name;
	}
	public void setrLast_name(String rLast_name) {
		this.rLast_name = rLast_name;
	}
	public String getrEmail() {
		return rEmail;
	}
	public void setrEmail(String rEmail) {
		this.rEmail = rEmail;
	}
	public String getrPassword() {
		return rPassword;
	}
	public void setrPassword(String rPassword) {
		this.rPassword = rPassword;
	}
	public String getrMno() {
		return rMno;
	}
	public void setrMno(String rMno) {
		this.rMno = rMno;
	}
	
	

}
